import React from 'react';
import { Link, useParams } from 'react-router-dom';

export default function AdminHome() {
  const { path } = useParams();

  return (
    <div style={{ textAlign: 'center' }}>
      <h1>Welcome Admin</h1>
      <div style={{ marginBottom: '20px' }}>
        <Link to="/adminHome/expertRegistration" style={{ marginRight: '20px' }}>Expert Registration</Link>
        <Link to="/adminHome/manageAccount" style={{ marginRight: '20px' }}>Manage Account</Link>
        <Link to="/adminHome/createQuizCategories" style={{ marginRight: '20px' }}>Create Quiz Categories</Link>
        <Link to="/adminHome/addQuizzes">Add Quizzes</Link>
        <li>
        <Link to="/logout" className="nav-link px-3">LogOut</Link>
        </li>
      </div>
    </div>
  );
}
